In TypeScript, you can indicate that an implicit conversion or inferred type is likely to occur for certain values while explicitly stating the desired type when creating those instances using `new`. Here's how you can achieve that:

1. **Using `infer` (or a similar construct)**: This allows you to infer the expected type based on the input.

```typescript
type Person = {
  name: string;
  age: number;
};

const personWithAge: Person = { name: "Alice", age: 30 };
console.log(personWithAge instanceof Person); // true

// Note: If you want to check if the actual value has specific types instead of infering,
// use conditional typing or explicit type checking.
```

2. **Type guards**: This feature lets you write a single type assertion (`as`) expression at compile-time.

```typescript
type Person = {
  name: string;
  age: number;
};
const validPerson: Person = { name: "Alice", age: 30 };
const invalidPerson: { name: 'Bob'; age: 30 } = { name: "Alice", age: 30 };

if (validPerson as Person) {
  console.log(validPerson);
}

// Or:
if (typeof invalidPerson === 'object' && 'name' in invalidPerson && typeof invalidPerson.name === 'string' && 'age' in invalidPerson) {
  console.log(invalidPerson);
}
```

3. **Explicit type definitions**: If you need more control over what the type system knows about a variable or instance, you can define it explicitly before using it.

```typescript
interface Person {
  name: string;
  age: number;
}

const alice: Person = { name: "Alice", age: 30 };

// Using the defined interface without explicit type hints
function sayHello(name: Person['name'] | undefined): void {
  if (name !== undefined) {
    console.log(`Hello, ${name}!`);
  }
}

sayHello(alice); // Hello, Alice!
```

These methods allow you to provide explicit type information and express expectations clearly when working with TypeScript.

